import ExpenseItem from './ExpenseItem';
import './Expenses.css'
import Card from './Card';

function Expenses(props){
    return(
        <Card className="expenses">
            <ExpenseItem
            date={props.data[0].date}
            title={props.data[0].title}
            amount={props.data[0].amount}>
            </ExpenseItem>
        </Card>
    )
}

export default Expenses;
